DO EN DIFERENTES ÁMBITOS DE CRECIMIENTO Y DESARROLLO INTEGRAL: PROFESIONAL, PERSONAL, FAMILIAR, SALUD, AUTOCUIDADO, ETCÉTERA. ADICIONALMENTE, ES UN ENTORNO DE TRABAJO SIEMPRE PARTICIPATIVO Y CONSTRUCTIVO DONDE SIEMPRE HAY ESPACIO PARA LA CREACIÓN, APORTE DE IDEAS. NO TODO ESTÁ CREADO Y DEBIDAMENTE ORGANIZADO Y ESTO HACE MÁS INTERESANTE MI TRABAJO, HAY ESPACIO PARA CREAR, INNOVAR, ESO ES AGRADABLE, NO SON ACTIVIDADES NETAMENTE OPERATIVAS Y REPETITIVAS.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,NULL,'',10,8,9,10,10,1,NULL,NULL,NULL,NULL,1,2,NULL,4,5,6,3,'',10,10,10,10,8,1,6,'VALLEDUPAR',3,6,5,7,'2015-11-03 23:06:21'),(233,1100,'flor.insuasty@restituciondetierras.gov.co',2,2,6,3,0,35,2,6,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,8,10,10,1,NULL,2,3,NULL,NULL,NULL,NULL,NULL,'',1,1,2,3,NULL,NULL,NULL,NULL,NULL,'',1,1,2,5,8,3,3,1,1,1,97,97,97,97,97,97,97,1,1,NULL,NULL,NULL,NULL,NULL,NULL,7,NULL,NULL,NULL,NULL,NULL,NULL,'',9,9,8,9,2,2,2,2,1,1,2,3,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,NULL,'',7,7,8,8,7,1,2,NULL,NULL,NULL,1,NULL,3,NULL,NULL,NULL,5,'',5,7,8,7,7,1,11,'PASTO',1,8,5,8,'2015-11-03 23:16:13'),(234,1646,'nancy.ordonez@restituciondetierras.gov.co',1,3,0,2,0,31,2,8,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,12,7,9,2,NULL,NULL,3,4,NULL,NULL,NULL,NULL,'',1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',1,1,1,5,8,1,5,6,7,5,5,7,7,5,6,7,8,1,1,1,NULL,3,NULL,5,NULL,7,NULL,NULL,10,11,NULL,NULL,'',NULL,10,7,9,2,2,1,1,1,1,2,NULL,4,NULL,NULL,7,NULL,NULL,'',NULL,NULL,3,NULL,5,6,NULL,NULL,NULL,'',7,7,7,8,8,1,2,NULL,NULL,NULL,NULL,NULL,NULL,4,5,NULL,3,'',7,7,7,7,6,1,11,'PASTO',5,6,5,9,'2015-11-03 23:29:56'),(235,1424,'edilma.rojas@restituciondetierras.gov.co',1,2,6,7,0,42,2,6,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,NULL,12,10,10,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',1,NULL,NULL,NULL,NULL,NULL,6,NULL,NULL,'',1,1,1,9,10,7,6,6,8,97,97,8,7,9,7,9,9,2,1,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',NULL,10,10,